SOLUTION:
&lt;p&gt;SQL utilizado na gera&#231;&#227;o de rela&#231;&#227;o&#160;&lt;span style="background-color: #fff4df; font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif'; font-size: 11px;"&gt;Docente x curso x unidade academica x campus&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;&lt;span style="background-color: #fff4df; font-size: 11px;"&gt;&lt;span style="font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif';"&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;select DISTINCT D.NOME_DOCENTE DOCENTE, CP.EMAIL, U2.NOME_UNIDADE UNIDADE, CC.NOME_CURSO_COMPLETO CURSO, CAM.DESCRICAO CAMPUS&lt;/p&gt;
&lt;p&gt;&lt;span style="background-color: #fff4df; font-size: 11px;"&gt;&lt;span style="font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif';"&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;from TURMAS_VAGAS tv&lt;/p&gt;
&lt;p&gt;&lt;span style="background-color: #fff4df; font-size: 11px;"&gt;&lt;span style="font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif';"&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;inner join TURMAS_DOCENTES td on td.ID_TURMA = tv.ID_TURMA&lt;/p&gt;
&lt;p&gt;&lt;span style="background-color: #fff4df; font-size: 11px;"&gt;&lt;span style="font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif';"&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;inner join sie_web.VW_DOCENTES d on d.ID_CONTRATO_RH = td.ID_DOCENTE&lt;/p&gt;
&lt;p&gt;&lt;span style="background-color: #fff4df; font-size: 11px;"&gt;&lt;span style="font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif';"&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;INNER JOIN CURSOS C ON &#160;C.ID_CURSO = TV.ID_CURSO&lt;/p&gt;
&lt;p&gt;&lt;span style="background-color: #fff4df; font-size: 11px;"&gt;&lt;span style="font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif';"&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;INNER JOIN SIE_WEB.VW_COMPLEMENTO_CURSOS CC ON CC.ID_CURSO = TV.ID_CURSO&lt;/p&gt;
&lt;p&gt;&lt;span style="background-color: #fff4df; font-size: 11px;"&gt;&lt;span style="font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif';"&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;INNER JOIN ORG_INSTITUICAO U ON U.ID_UNIDADE = C.ID_UNIDADE&lt;/p&gt;
&lt;p&gt;&lt;span style="background-color: #fff4df; font-size: 11px;"&gt;&lt;span style="font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif';"&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;INNER JOIN ORG_INSTITUICAO U2 ON U2.ID_UNIDADE = U.ID_UNIDADE_SUP&lt;/p&gt;
&lt;p&gt;&lt;span style="background-color: #fff4df; font-size: 11px;"&gt;&lt;span style="font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif';"&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;inner join dbsm.CONTRATOS_RH rh on rh.ID_CONTRATO_RH &#160;= d.ID_CONTRATO_RH&lt;/p&gt;
&lt;p&gt;&lt;span style="background-color: #fff4df; font-size: 11px;"&gt;&lt;span style="font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif';"&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;inner join dbsm.FUNCIONARIOS f on &#160;RH.ID_FUNCIONARIO = f.ID_FUNCIONARIO&lt;/p&gt;
&lt;p&gt;&lt;span style="background-color: #fff4df; font-size: 11px;"&gt;&lt;span style="font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif';"&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;join dbsm.pessoas p on f.ID_PESSOA = p.ID_PESSOA&lt;/p&gt;
&lt;p&gt;&lt;span style="background-color: #fff4df; font-size: 11px;"&gt;&lt;span style="font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif';"&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;JOIN SIE_WEB.COMPLEMENTO_PESSOAS CP ON CP.ID_PESSOA = P.ID_PESSOA&lt;/p&gt;
&lt;p&gt;&lt;span style="background-color: #fff4df; font-size: 11px;"&gt;&lt;span style="font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif';"&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;INNER JOIN TAB_ESTRUTURADA CAM ON CAM.COD_TABELA = C.LOCAL_FISICO_TAB AND CAM.ITEM_TABELA = C.LOCAL_FISICO_ITEM&lt;/p&gt;
&lt;p&gt;&lt;span style="background-color: #fff4df; font-size: 11px;"&gt;&lt;span style="font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif';"&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;where tv.ANO = 2012 and tv.SITUACAO &lt;&gt; 'E' --n&#227;o exclu&#237;do&lt;/p&gt;
&lt;p&gt;&lt;span style="background-color: #fff4df; font-size: 11px;"&gt;&lt;span style="font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif';"&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;

&lt;p&gt;Item 1 - Modificado workflow: ser&#227;o adicionados followups enquanto os chamados estiverem nos estados de novo a pendente, enquanto que para finalizar o chamado, deve-se adicionar uma solu&#231;&#227;o na aba "solu&#231;&#227;o", que automaticamente ser&#227;o mudados entre os estados solucionado e fechado. No entanto para fechar definitivamente o chamado, o usu&#225;rio dever&#225; confirmar a solu&#231;&#227;o proposta para o t&#233;cnico, ainda assim, caso o usu&#225;rio solicitante n&#227;o o fa&#231;a, o sistema ir&#225; fechar os chamados em 30 dias se n&#227;o houver feedback por parte do usu&#225;rio.&lt;/p&gt;
&lt;p&gt;2 - J&#225; foi resolvido.&lt;/p&gt;
&lt;p&gt;3 e 4 - Adicionado template (modelo) na descri&#231;&#227;o do chamado, sendo assim, n&#227;o ser&#225; mais necess&#225;rio adicionar tais campos.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;&lt;span style="font-size: small;"&gt;Reprova&#231;&#245;es por alunos de Sistemas de Informa&#231;&#227;o:&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;
&lt;hr /&gt;
&lt;p&gt;SELECT DISTINCT polo.DESCRICAO AS POLO, ca.MATR_ALUNO AS MATRICULA, p.NOME_PESSOA_UP AS NOME, ac.COD_ATIV_CURRIC AS COD_DISCIPLINA, ac.NOME_ATIV_CURRIC AS NOME_DISCIPLINA, con.DESCRICAO AS CONCEITO FROM CURRICULO_ALUNO cv&lt;br /&gt;JOIN CURSOS_ALUNOS ca ON (cv.ID_CURSO_ALUNO = ca.ID_CURSO_ALUNO)&lt;br /&gt;JOIN ALUNOS a ON (ca.ID_ALUNO = a.ID_ALUNO)&lt;br /&gt;JOIN PESSOAS p ON (a.ID_PESSOA = p.ID_PESSOA)&lt;br /&gt;JOIN VERSOES_CURSOS vc ON (ca.ID_VERSAO_CURSO = vc.ID_VERSAO_CURSO)&lt;br /&gt;JOIN CURSOS c ON (vc.ID_CURSO = c.ID_CURSO)&lt;br /&gt;JOIN ATIVIDADES_CURRIC ac ON (cv.ID_ATIV_CURRIC = ac.ID_ATIV_CURRIC)&lt;br /&gt;JOIN COMPLEMENTO_CURSOS_ALUNOS cca ON (ca.ID_CURSO_ALUNO = cca.ID_CURSOS_ALUNOS_SIE)&lt;br /&gt;JOIN TAB_ESTRUTURADA polo ON (cca.POLO_ITEM = polo.ITEM_TABELA AND cca.POLO_TAB = polo.COD_TABELA)&lt;br /&gt;JOIN TAB_ESTRUTURADA con ON (cv.CONCEITO_ITEM = con.ITEM_TABELA AND cv.CONCEITO_TAB = con.COD_TABELA)&lt;br /&gt;WHERE c.ID_CURSO = 2411&lt;br /&gt;-- SOMENTE REPROVA&#199;&#213;ES&lt;br /&gt;AND cv.CONCEITO_ITEM IN (15, 16, 17, 22)&lt;br /&gt;ORDER BY polo.DESCRICAO, ca.MATR_ALUNO, ac.COD_ATIV_CURRIC;&lt;/p&gt;
&lt;hr /&gt;
&lt;p&gt;&lt;strong&gt;&lt;span style="font-size: small;"&gt;Disciplinas a cursar por alunos de Sistemas de Informa&#231;&#227;o:&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;
&lt;hr /&gt;
&lt;p&gt;SELECT xpolo.DESCRICAO AS POLO, xca.MATR_ALUNO AS MATRICULA, xp.NOME_PESSOA AS NOME, mundo.ID_CURSO_ALUNO, xac.COD_ATIV_CURRIC AS CODIGO_DISCIPLINA, xac.NOME_ATIV_CURRIC AS NOME_DISCIPLINA FROM ( &lt;br /&gt;&#160;&#160;&#160; -- ALUNOS DO CURSO&lt;br /&gt;&#160;&#160;&#160; SELECT distinct sub.ID_CURSO_ALUNO, dc.ID_DISCIPLINA FROM (&lt;br /&gt;&#160;&#160;&#160; &#160;&#160;&#160; SELECT sca.ID_CURSO_ALUNO FROM CURSOS_ALUNOS sca&lt;br /&gt;&#160;&#160;&#160; &#160;&#160;&#160; JOIN VERSOES_CURSOS svc ON (sca.ID_VERSAO_CURSO = svc.ID_VERSAO_CURSO)&lt;br /&gt;&#160;&#160;&#160; &#160;&#160;&#160; JOIN CURSOS sc ON (svc.ID_CURSO = sc.ID_CURSO)&lt;br /&gt;&#160;&#160;&#160; &#160;&#160;&#160; WHERE sc.ID_CURSO = 2411&lt;br /&gt;&#160;&#160;&#160; &#160;&#160;&#160; AND (sca.FORMA_EVASAO_ITEM IS NULL OR sca.FORMA_EVASAO_ITEM = 1)&lt;br /&gt;&#160;&#160;&#160; ) sub, VERSOES_CURSOS vc&lt;br /&gt;&#160;&#160;&#160; JOIN CURSOS c ON (vc.ID_CURSO = c.ID_CURSO)&lt;br /&gt;&#160;&#160;&#160; JOIN ESTRUTURA_CURRIC ec ON (vc.ID_VERSAO_CURSO = ec.ID_VERSAO_CURSO)&lt;br /&gt;&#160;&#160;&#160; JOIN DISCIPLINAS_CURRIC dc ON (ec.ID_ESTRUTURA_CUR = dc.ID_ESTRUTURA_CUR)&lt;br /&gt;&#160;&#160;&#160; JOIN ATIVIDADES_CURRIC ac ON (dc.ID_DISCIPLINA = ac.ID_ATIV_CURRIC)&lt;br /&gt;&#160;&#160;&#160; WHERE c.ID_CURSO = 2411&lt;br /&gt;&#160;&#160;&#160; AND dc.SITUACAO_CURRICULO = 'A'&lt;br /&gt;&#160;&#160;&#160; -- MENOS ELETIVAS&lt;br /&gt;&#160;&#160;&#160; AND dc.TIPO_DISC_ITEM NOT IN (2, 4, 5)&lt;br /&gt;&#160;&#160;&#160; AND dc.ID_DISCIPLINA NOT IN (&lt;br /&gt;&#160;&#160;&#160; &#160;&#160;&#160; -- DISCIPLINAS J&#193; PAGAS&lt;br /&gt;&#160;&#160;&#160; &#160;&#160;&#160; SELECT DISTINCT sscv.ID_ATIV_CURRIC FROM CURRICULO_ALUNO sscv&lt;br /&gt;&#160;&#160;&#160; &#160;&#160;&#160; JOIN CURSOS_ALUNOS ssca ON (sscv.ID_CURSO_ALUNO = ssca.ID_CURSO_ALUNO)&lt;br /&gt;&#160;&#160;&#160; &#160;&#160;&#160; JOIN ALUNOS ssa ON (ssca.ID_ALUNO = ssa.ID_ALUNO)&lt;br /&gt;&#160;&#160;&#160; &#160;&#160;&#160; JOIN VERSOES_CURSOS ssvc ON (ssca.ID_VERSAO_CURSO = ssvc.ID_VERSAO_CURSO)&lt;br /&gt;&#160;&#160;&#160; &#160;&#160;&#160; JOIN CURSOS ssc ON (ssvc.ID_CURSO = ssc.ID_CURSO)&lt;br /&gt;&#160;&#160;&#160; &#160;&#160;&#160; JOIN ATIVIDADES_CURRIC ssac ON (sscv.ID_ATIV_CURRIC = ssac.ID_ATIV_CURRIC)&lt;br /&gt;&#160;&#160;&#160; &#160;&#160;&#160; WHERE ssc.ID_CURSO = 2411&lt;br /&gt;&#160;&#160;&#160; &#160;&#160;&#160; -- SOMENTE APROVA&#199;&#213;ES&lt;br /&gt;&#160;&#160;&#160; &#160;&#160;&#160; AND sscv.CONCEITO_ITEM IN (13, 14, 21)&lt;br /&gt;&#160;&#160;&#160; &#160;&#160;&#160; AND ssca.ID_CURSO_ALUNO = sub.ID_CURSO_ALUNO&lt;br /&gt;&#160;&#160;&#160; ) &lt;br /&gt;)&#160; mundo&lt;br /&gt;JOIN ATIVIDADES_CURRIC xac on (xac.ID_ATIV_CURRIC = mundo.ID_DISCIPLINA)&lt;br /&gt;JOIN CURSOS_ALUNOS xca ON (mundo.ID_CURSO_ALUNO = xca.ID_CURSO_ALUNO)&lt;br /&gt;JOIN COMPLEMENTO_CURSOS_ALUNOS xcca ON (xca.ID_CURSO_ALUNO = xcca.ID_CURSOS_ALUNOS_SIE)&lt;br /&gt;JOIN TAB_ESTRUTURADA xpolo ON (xcca.POLO_ITEM = xpolo.ITEM_TABELA AND xcca.POLO_TAB = xpolo.COD_TABELA)&lt;br /&gt;JOIN ALUNOS xa ON (xca.ID_ALUNO = xa.ID_ALUNO)&lt;br /&gt;JOIN PESSOAS xp ON (xa.ID_PESSOA = xp.ID_PESSOA)&lt;br /&gt;ORDER BY xpolo.DESCRICAO, xp.NOME_PESSOA, xac.COD_ATIV_CURRIC;&lt;/p&gt;

&lt;p&gt;Consulta utilizada:&lt;/p&gt;
&lt;hr /&gt;
&lt;p&gt;SELECT ca.MATR_ALUNO AS MATRICULA, p.NOME_PESSOA_UP AS NOME, c.NOME_CURSO_DIPLOMA AS CURSO&lt;br /&gt;FROM CURSOS_ALUNOS ca&lt;br /&gt;JOIN VERSOES_CURSOS vc USING (ID_VERSAO_CURSO)&lt;br /&gt;JOIN CURSOS c USING (ID_CURSO)&lt;br /&gt;JOIN ALUNOS a USING (ID_ALUNO)&lt;br /&gt;JOIN PESSOAS p USING (ID_PESSOA)&lt;br /&gt;WHERE ca.FORMA_EVASAO_ITEM=4 -- formado&lt;br /&gt;AND c.NIVEL_CURSO_ITEM=3 -- gradua&#231;&#227;o&lt;br /&gt;AND ca.ANO_EVASAO=2012&lt;br /&gt;ORDER BY c.NOME_CURSO_DIPLOMA, p.NOME_PESSOA_UP;&lt;/p&gt;

