&lt;p&gt;A lista de participantes de uma disciplina informa h&#225; quanto tempo um aluno acessou aquela disciplina. Ent&#227;o, &#233; poss&#237;vel que um aluno tenha acessado a plataforma, entrado em uma ou mais disciplinas e ainda assim constar que em uma disciplina espec&#237;fica ele n&#227;o tem nenhum acesso. Para que eu possa verificar se h&#225; algum problema, pe&#231;o que informe a disciplina e o aluno onde esse comportamento foi observado.&lt;/p&gt;
