&lt;p&gt;De acordo com o Moodle, os seguintes alunos nunca acessaram a referida disciplina:&lt;br /&gt;&lt;br /&gt;GUSTAVO JOS&#201; SILVA CAVALCANTE&lt;br /&gt;ANA CL&#193;UDIA PORFIRIO DA SILVA&lt;br /&gt;ELZA MARIA SOARES DA SILVA&lt;br /&gt;KARLLA YZABELE FERNANDES&lt;br /&gt;ERIKA CAROLINA DA SILVA BANDEIRA&lt;br /&gt;EVYJANSSEN JOSEPH VITAL DA SILVA&lt;br /&gt;DURVAL FELISBERTO DA ROCHA&lt;br /&gt;SUELLANE THAINNY PINHEIRO BARBOSA&lt;br /&gt;D&#234;nis Belo&lt;br /&gt;SUELLEN THAIS PINHEIRO BARBOSA&lt;br /&gt;MARCIA MARIA DA SILVA&lt;br /&gt;&lt;br /&gt;Ainda segundo o Moodle, para estes n&#227;o consta nenhum registro de envio de atividade ou participa&#231;&#227;o em f&#243;rum.&lt;/p&gt;

&lt;p&gt;Atualiza&#231;&#227;o do Java, modifica&#231;&#227;o das permiss&#245;es dos usu&#225;rios do setor para gravar na pasta c:\arquivos de programas\java e instala&#231;&#227;o do Firefox.&lt;/p&gt;
