&lt;p&gt;A vers&#227;o nova do Moodle restringiu o envio de mensagem formatada entre usu&#225;rios.&lt;/p&gt;
&lt;p&gt;A caixa de texto exibida ao compor uma mensagem para um &#250;nico destinat&#225;rio j&#225; n&#227;o mostra as ferramentas de formata&#231;&#227;o. Entretanto, atrav&#233;s da lista de participantes, na qual se pode marcar um ou mais usu&#225;rios para o envio de mensagem, ainda s&#227;o exibidas as ferramentas de formata&#231;&#227;o. As mensagens enviadas a partir dessa tela (como a enviada pelo tutor) perdem sua formata&#231;&#227;o ao serem visualizadas no Moodle, por&#233;m, os usu&#225;rios que n&#227;o estejam online no momento do envio receber&#227;o a mensagem em seu e-mail com a formata&#231;&#227;o original.&lt;/p&gt;
&lt;p&gt;Em resumo: a mensagem s&#243; mant&#233;m a formata&#231;&#227;o quando recebida no e-mail. No Moodle, a formata&#231;&#227;o &#233; ignorada.&lt;/p&gt;

