&lt;p&gt;Ingrid, a requerente dever&#225; acessar o menu PROGRAD -&gt; Consulta de Disciplinas. L&#225; &#233; poss&#237;vel visualizar todas as disciplinas de um curso, podendo exclu&#237;-las (no bot&#227;o "Remover esta Disciplina") ou renome&#225;-las (no bot&#227;o "Editar Disciplina"). Assim, a requerente poder&#225; excluir MATD048 e MATD050 e renomear MATD049.&lt;/p&gt;
&lt;p&gt;Para incluir disciplinas no curr&#237;culo, a requerente dever&#225; acessar o menu PROGRAD -&gt; Curr&#237;culo do Curso, selecionar o curso e a matriz corrente e em seguida clicar em "Adicionar Nova Disciplina &#224; Grade" (o bot&#227;o com &#237;cone de mais "+").&lt;/p&gt;
&lt;p&gt;Finalmente, pe&#231;a &#224; requerente para nos comunicar caso haja quaisquer problemas na realiza&#231;&#227;o destes procedimentos.&lt;/p&gt;
