&lt;p&gt;Ao visualizar os envios, percebi que algu&#233;m (provavelmente um tutor), travou os envios de alguns alunos, exibindo uma mensagem "Altera&#231;&#227;o de envio n&#227;o permitida" na coluna "Status". Se a quest&#227;o for essa, basta um tutor destravar o envio, devendo acessar a rela&#231;&#227;o de envios e, na coluna "Editar", acessar o bot&#227;o "A&#231;&#245;es" e clicar em "Permite mudan&#231;as no envio".&lt;/p&gt;
&lt;p&gt;Outros alunos simplesmente salvaram o arquivo como rascunho e n&#227;o concluiram o processo de envio.&lt;/p&gt;
&lt;p&gt;Entretanto, o prazo de envio da tarefa expirou. Al&#233;m disso, a tarefa foi configurada para permitir apenas 1 envio. Assim, o professor (ou algu&#233;m com permiss&#227;o equivalente, como &#233; o caso do coordenador), dever&#225; alterar a configura&#231;&#227;o da tarefa, bastando para isso:&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Acessar o ambiente da disciplina;&lt;/li&gt;
&lt;li&gt;Clicar em ativar edi&#231;&#227;o;&lt;/li&gt;
&lt;li&gt;Clicar no bot&#227;o "Atualizar" correspondente &#224; Tarefa 2;&lt;/li&gt;
&lt;li&gt;Aumentar o valor de "N&#250;mero m&#225;ximo de arquivos enviados";&lt;/li&gt;
&lt;li&gt;Alterar a op&#231;&#227;o "Impedir envio atrasado" para "N&#227;o".&lt;/li&gt;
&lt;/ul&gt;

&lt;p&gt;No teste realizado foi apresentada a mensagem de frequ&#234;ncia salva.&lt;/p&gt;
