&lt;p&gt;Os computadores estavam numa rede diferente da rede reitoria (172.21.X.X).&lt;br /&gt;Para solucionar o problema, resalizei os seguintes comandos no prompt de comados do Windows:&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;ipconfig /release, para desabilitar a placa de rede;&lt;/li&gt;
&lt;li&gt;ipconfig /renew, para solicitar novo endere&#231;o IP.&lt;/li&gt;
&lt;/ul&gt;

&lt;p&gt;Efetuei as devidas configura&#231;&#245;es no servidor web para:&lt;/p&gt;
