&lt;p&gt;O usua&#341;io j&#225; estava cadastrado na rede reitoria, ele antes trabalhava no DAP. Eu o adicionei para secretaria do DCF como consta no formul&#225;rio. Os dados de acesso continuam os mesmos.&lt;/p&gt;

&lt;p&gt;Testada a porta WAN e o roteador n&#227;o apresentou nenhum defeito. Favor Solicitar ao Setor a presen&#231;a do NTI para instalar. O DHCP j&#225; est&#225; desabilitado.&lt;/p&gt;
