&lt;p&gt;Coment&#225;rio anterior:&lt;/p&gt;
&lt;p&gt;"Como se trata de uma impressora conectada via porta USB, o suporte n&#227;o faz o compartilhamento dela em nenhum computador que esteja na rede reitoria, pois o compartilhamento tem que ser "autorizado" no servidor. Na rede reitoria, somente compartilhamos impressoras que est&#227;o conectadas via cabo de rede. Repassar o chamado para o setor de REDES."&lt;/p&gt;

