&lt;p&gt;Quando o usu&#225;rio se conecta ao SERPRO, ele armazena alguns dados na&#160;pasta de documentos do usu&#225;rio. Estes dados s&#227;o armazenados em pastas cujos nomes&#160;cont&#233;m a identifica&#231;&#227;o do SERPRO.&lt;/p&gt;
