&lt;p&gt;Scanner n&#227;o apresentou nenhum problema est&#225; tudo OK.&lt;/p&gt;
&lt;p&gt;O problema pode ser o modo como ele foi instalado.&lt;/p&gt;

&lt;div style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"&gt;Encaminhar o tutorial para o solicitante.&lt;/div&gt;
&lt;div style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"&gt;CRIAR AMBIENTES NO MOODLE PARA TURMAS DE GRADUA&#199;&#195;O PRESENCIAL.&lt;br /&gt;&lt;br clear="all" /&gt;1&#186; passo :efetuar login no Sicam :&#160;&lt;a style="color: #1155cc;" href="http://sicam.ead.ufal.br/" target="_blank"&gt;sicam.ead.ufal.br&lt;/a&gt;&#160;&#160;(login e senha do Sie-web)&lt;br /&gt;&#160; &#160; 1.1 passo: &#160;se n&#227;o conseguir se logar no Sicam, entrar em&#160;&lt;a style="color: #1155cc;" href="http://perfil.ufal.br/" target="_blank"&gt;perfil.ufal.br&lt;/a&gt;&#160;&#160;(login e senha do Sie-web) e&#160;depois tentar novamente entrar no Sicam.&lt;br /&gt;&lt;br /&gt;2&#186; passo: estando dentro do Sicam, clicar no bot&#227;o "Novo ambiente" - ser&#227;o listadas todas as turmas em que o professor estiver associado. Obs.&#160;&lt;span style="color: #222222; font-family: arial, sans-serif;"&gt;Turmas com ambientes j&#225; solicitados (inclusive por outros docentes) n&#227;o s&#227;o listadas.&lt;/span&gt;&#160;&lt;/div&gt;
&lt;div style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"&gt;3&#186; passo: o&#160;professor escolhe a cria&#231;&#227;o de ambiente por disciplina. Obs: &#233; poss&#237;vel juntar disciplinas com o mesmo nome, para isso deve clicar no bot&#227;o "Adicionar" para as turmas de mesmo nome e depois, na parte inferior da p&#225;gina, clicar no bot&#227;o:"Criar ambiente".&lt;/div&gt;
&lt;div style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"&gt;O sistema cria o ambiente, cadastra os alunos e confirma essas a&#231;&#245;es.&lt;/div&gt;
&lt;div style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"&gt;4&#186; passo: &#160;O professor deve clicar no bot&#227;o: "Avan&#231;ar". O ambiente no Moodle foi criado.&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;/div&gt;
&lt;div style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"&gt;PARA ACESSAR OS NOVOS AMBIENTES:&lt;br /&gt;1&#170; op&#231;&#227;o: a partir do Sicam, &#160;no menu &#160;"Meus ambientes"&lt;br /&gt;2&#170; op&#231;&#227;o: acessando o novo moodle da gradua&#231;&#227;o:&#160;&lt;a style="color: #1155cc;" href="http://presencial.ead.ufal.br/" target="_blank"&gt;presencial.ead.ufal.br&lt;/a&gt;&#160;(login e senha do Sie-web)&lt;/div&gt;

&lt;p&gt;Fiz limpeza de registros e o computador acessou normalmente as p&#225;ginas da internet sem desligar o computador.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Pode fechar o chamado.&lt;/p&gt;

&lt;p&gt;Requerente j&#225; est&#225; imprimindo normalmente.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Impressora aparecia como conectada mas n&#227;o respondia a solicita&#231;&#227;o de impress&#227;o. Apaguei as pastas de configura&#231;&#227;o do SERPRO que ficam na conta do usu&#225;rio. Ao acessar o SERPRO, as configura&#231;&#245;es foram inseridas novamente e tudo voltou a normalidade.&lt;/p&gt;

&lt;p&gt;O problema foi ocasionado pela atualiza&#231;&#227;o de um plug-in para o Moodle.&lt;/p&gt;
&lt;p&gt;Este plug-in continha uma vers&#227;o antiga do editor html. Plug-in e editor atualizados.&#160;&lt;/p&gt;
&lt;p&gt;Problema resolvido.&lt;/p&gt;

&lt;p&gt;Fiz uma troca de monitor, solicitado pela Thays e a instala&#231;&#227;o de uma impressora hp p2055.&lt;/p&gt;
&lt;p&gt;N&#227;o foi poss&#237;vel instalar a impressora HP CM2320 pois ela n&#227;o est&#225; em rede, e sim instalada diretamente no computador, &#233; preciso um cabo de rede para que possa ser instalado.&lt;/p&gt;
&lt;p&gt;N&#227;o foi poss&#237;vel instalar a impressora Canon ir 1025 em rede, pois o ponto de internet ao qual est&#225; ligado apresenta problemas de conectividade.&lt;/p&gt;
&lt;p&gt;Enfim, falta um cabo e an&#225;lise do ponto de rede para poss&#237;vel troca.&lt;/p&gt;

&lt;p&gt;Um dos computadores est&#225; apitando, ent&#227;o &#233; preciso traze-lo para o suporte para ver o que est&#225; acontecendo. Falei com a Luiza para que tragam o computador para c&#225;.&lt;/p&gt;
&lt;p&gt;O outro computador consegue se conectar via WIFI, por&#233;m com o sinal fraco. A antena do adaptador WIFI n&#227;o se encontrava plugada nele.&lt;/p&gt;
&lt;p&gt;Os pontos de rede da sala dos professores n&#227;o est&#227;o funcionando.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Pode fechar o chamado.&lt;/p&gt;

&lt;p&gt;Fechar Chamado.&lt;/p&gt;
