&lt;p&gt;"- Falha na altera&#231;&#227;o dos dados do aluno!&lt;br /&gt;&#160;- ORA-00001: unique constraint(DBSM.PK_PESSOA) violated."&lt;/p&gt;

&lt;p&gt;Problema resolvido:&lt;/p&gt;
&lt;p&gt;Haviam arquivos .htaccess indevidamente colocados nos diret&#243;rios pec/sites e pec/sites/default/files o que estava causando problemas entre servidor e aplica&#231;&#227;o do site.&lt;/p&gt;
&lt;p&gt;Como no novo servidor fora atualizada a vers&#227;o do PHP para a 5.3, foram atualizados os m&#243;dulos imagecache e imageapi, diante dos bugs das vers&#245;es que o site apresentava.&lt;/p&gt;
&lt;p&gt;Ps.: O problema poderia ter sido resolvido pelo t&#233;cnico que desenvolveu o site. No entanto, resolvemos auxiliar neste caso para verificar o comportamento de servi&#231;os/recursos do novo servidor web. Ie: permiss&#245;es, utiliza&#231;&#227;o de recursos, banco de dados, funcionalidades etc.&lt;/p&gt;

