&lt;div&gt;O ambiente foi criado. Professor e alunos receberam essa confirma&#231;&#227;o no e-mail (lembrando que os e-mails n&#227;o devem ser do Bol, Uol ou Hotmail).&lt;/div&gt;
&lt;div&gt;O motivo do erro foi que existiam dois alunos com o mesmo e-mail. A aluna ELISANGELA DA SILVA NUNES estava com o e-mail de Rodolfo (rodolfovillar@hotmail.com). Para realizarmos a cria&#231;&#227;o do ambiente no Moodle foi necess&#225;rio alterarmos o e-mail da aluna ELISANGELA no SieWeb, criando um e-mail tempor&#225;rio.&lt;/div&gt;
&lt;div&gt;Assim, entrar em contato com o professor e informar que a aluna&#160;ELISANGELA DA SILVA NUNES precisa entrar em contato com o NTI para alterarmos o e-mail dela no SieWeb.&lt;/div&gt;

