&lt;p&gt;O problema foi que tivemos perda de conectividade com o POP, mas j&#225; voltou ao normal.&lt;/p&gt;

&lt;p&gt;O sistema de envio de e-mail do Moodle tem funcionado corretamente para e-mails do Gmail.&lt;br /&gt;Provavelmente as mensagens estejam chegando na caixa de Spam. N&#227;o temos outra solu&#231;&#227;o para esse caso.&lt;/p&gt;
&lt;p&gt;--------------------------------------------------------------------------------------------------------&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Algumas pessoas com e-mails do Gmail est&#227;o recebendo as mensagens enviadas atrav&#233;s do Moodle na caixa de Spam. O soliciante est&#225; com dois e-mails cadastrados:&#160;&lt;a style="text-decoration: initial; color: #428ab5; font-family: 'Myriad Pro', Myriad, helvetica, arial, sans-serif; font-size: 14.44444465637207px; line-height: 21.111112594604492px;" title="" href="mailto:%6d%69lt%6f%6e%2e%70%6f%73%2egp.u%66%61%6c@%6c%69%76%65.%63%6f%6d"&gt;milton.pos.gp.ufal@live.com&lt;/a&gt;&#160; &gt;&gt; live.com tamb&#233;m pertence a Microsoft e &#160;pode bloquear os e-mails enviados do Moodle.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Solicitar que o usu&#225;rio deixe cadastrado apenas o e-mail&#160;milton.pos.pg.ufal@gmail.com e confira sua caixa de SPAM.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;O Moodle est&#225; enviando e-mails normalmente.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;---------------------------------------------------------------------------------------------------&lt;/p&gt;
