&lt;p&gt;No perfil, o e-mail cadastrado &#233;&#160;milton.pos.gp.ufal@live.com.&lt;/p&gt;
&lt;p&gt;Mas ele solicitou que todas &#160;as notifica&#231;&#245;es do sistema fossem enviadas para o e-mail: milton.estevam@hotmail.com.&lt;/p&gt;
&lt;p&gt;Pedir para o aluno verificar o e-mail&#160;milton.estevam@hotmail.com (conferir a caixa de Spam tamb&#233;m). E seria bom o aluno possuir apenas um e-mail cadastrado.&lt;/p&gt;

&lt;p&gt;Segue abaixo os dados de acesso:&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;usu&#225;rio: CPF&lt;/p&gt;
&lt;p&gt;senha: 123Mudar&lt;/p&gt;

&lt;p&gt;&lt;span style="background-color: #ffffff;"&gt;S&#243; aceitem a lista se todos os alunos estiverem com a matr&#237;cula, pois algusn estavam sem matr&#237;cula e n&#227;o foi poss&#237;vel encontr&#225;-los no sistema.&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;&lt;span style="background-color: #ffffff;"&gt;Lista gerada!&lt;/span&gt;&lt;/p&gt;

&lt;p&gt;Pessoal,&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Entrei em contato com a requerente e solicitei que ela reiniciasse os dois computadores da secretaria. Feito isso, entrei em contato novamente para saber se estava OK. So Sr. Melke me informou que esta OK.&lt;/p&gt;

&lt;p&gt;&lt;span style="font-size: small;"&gt;O e-mail da aluna &#233; do Hotmail.&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style="color: #281f18; font-family: 'Myriad Pro', Myriad, helvetica, arial, sans-serif; font-size: small; line-height: 21.111112594604492px;"&gt;Os dom&#237;nios bol, uol e hotmail est&#227;o bloqueando os e-mails enviados via Moodle por acharem que s&#227;o Spam. N&#227;o temos uma solu&#231;&#227;o r&#225;pida e definitiva para resolver isso. Devemos contratar outro servidor de e-mail e isso n&#227;o &#233; t&#227;o simples. Assim, usu&#225;rios que possuam conta na Bol, Uol ou Hotmail devem utilizar outro dom&#237;nio e sugerimos Gmail ou Yahoo para receber (sem problemas) os e-mails via Moodle.&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style="color: #281f18; font-family: 'Myriad Pro', Myriad, helvetica, arial, sans-serif; font-size: small; line-height: 21.111112594604492px;"&gt;Em breve todos alunos da Ufal possuir&#227;o um e-mail do dom&#237;nio Ufal, e assim, esse problema n&#227;o mais ser&#225; reportado.&lt;/span&gt;&lt;br style="color: #281f18; font-family: 'Myriad Pro', Myriad, helvetica, arial, sans-serif; font-size: 14.44444465637207px; line-height: 21.111112594604492px;" /&gt;&lt;br style="color: #281f18; font-family: 'Myriad Pro', Myriad, helvetica, arial, sans-serif; font-size: 14.44444465637207px; line-height: 21.111112594604492px;" /&gt;&lt;span style="color: #281f18; font-family: 'Myriad Pro', Myriad, helvetica, arial, sans-serif; font-size: small; line-height: 21.111112594604492px;"&gt;Avisar aos alunos sobre esse problema e pedir para modificarem o e-mail cadastrado no Moodle que n&#227;o seja dos dom&#237;nios Bol, Uol e Hotmail.&lt;/span&gt;&lt;/p&gt;

&lt;p&gt;Problemas com notas devem ser resolvidos no DRCA.&lt;/p&gt;
&lt;p&gt;Encaminhar a solicitante para o DRCA.&lt;/p&gt;
&lt;p&gt;Como consta em Ocorr&#234;ncias, o aluno trancou o semestre 2010/1, logo n&#227;o cursou nenhuma disciplina. Se o aluno concluiu alguma disciplina do per&#237;odo 2010/1 deve ser resolvido com o DRCA.&lt;/p&gt;

&lt;p&gt;O problema estava na forma como colocaram os cabos. S&#243; havia um cabo no telefone, o cabo que ia para a porta LAN. Coloquei mais um cabo para o PC e o telefone voltou a funcionar. Fiz os testes de fazer e recever liga&#231;&#245;es e funcionou normalmente.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Pode fechar o chamado.&lt;/p&gt;

&lt;p&gt;Haviam: 4 estabilizadores, 5 gabinetes e v&#225;rios teclados, mouses e monitores.&lt;/p&gt;
&lt;p&gt;S&#243; foi poss&#237;vel instalar 4 m&#225;quinas completas e apenas duas ficaram com acesso &#224; rede.&lt;/p&gt;
&lt;p&gt;Foi utilizado dois estabilizadores com duas m&#225;quinas em cada um.&lt;/p&gt;
&lt;p&gt;Em um dos lados do laborat&#243;rio n&#227;o haviam tomadas de energia nem de rede e &#233; onde h&#225; mais espa&#231;os para colocar as m&#225;quinas.&lt;/p&gt;

&lt;p&gt;Pessoal,&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;O Switch estava travado, sendo necess&#225;rio reiniciar o equipamento.&lt;/p&gt;

&lt;p&gt;O problema estava na fonte de alimenta&#231;&#227;o do telefone que estava mal conectada ao filtro de linha. Ap&#243;s conectar adequadamente o telefone e a internet voltaram a funcionar normalmente.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Pode fechar o chamado.&lt;/p&gt;

&lt;p&gt;Ambiente criado:&#160;&lt;span style="font-size: 0.9em; letter-spacing: 0.02em; font-family: arial, san-serif; font-weight: bold;"&gt;ECS - 2012.2&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;Informar ao solicitante que foram cadastrados pessoas com e-mails do hotmail, bol e uol. Sugerimos que essas pessoas cadastrem outro e-mail. E alterem sua senha no primeiro acesso ao ambiente.&lt;/p&gt;
&lt;p&gt;Login = SIAPE&lt;/p&gt;
&lt;p&gt;Senha = SIAPE&lt;/p&gt;

&lt;p&gt;Usu&#225;rio j&#225; estava cadastrado no Moodle.&lt;/p&gt;
&lt;p&gt;Atualizado o perfil:&lt;/p&gt;
&lt;p&gt;usu&#225;rio : CPF&lt;/p&gt;
&lt;p&gt;senha: 8 primeiros d&#237;gitos do CPF&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;O professor deve associ&#225;-lo como professor da disciplina.&lt;/p&gt;

&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;As disciplinas requeridas para matr&#237;culas n&#227;o fazem parte da grade curricular dos cursos dos alunos mencionados. Uma forma de efetuar essas matr&#237;culas deve ser ofertar as disciplinas como eletivas na grade curricular de cada curso. Isso deve ser feito pela PROGRAD.&lt;/p&gt;
&lt;p&gt;Informar ao solicitante que deve entrar em contato com a PROGRAD.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;

&lt;p&gt;O r&#225;dio do HU apresentou problemas durante o per&#237;odo da manh&#227;. Este r&#225;dio &#233; repons&#225;vel por fornecer a conectividade ao setor do solicitante. Neste &#237;nterim foram efetuados os devidos ajustes. No per&#237;odo da tarde j&#225; fora normalizado sua opera&#231;&#227;o.&#160;&lt;/p&gt;
&lt;p&gt;Destarte, o problema de lentid&#227;o na internet deve-se ao fato que a rede COMEP/RNP, da qual a UFAL aderiu recentemente, est&#225; enfrentando problemas a n&#237;vel nacional.&#160;&lt;/p&gt;
&lt;p&gt;Ps.: Conseguimos contato com o solicitante, mas n&#227;o foi poss&#237;vel atestar a solu&#231;&#227;o, pois o mesmo n&#227;o mais se encontrava no setor.&lt;/p&gt;

&lt;p&gt;Aluna sem usu&#225;rio no SIE.&lt;/p&gt;
&lt;p&gt;Criado o usu&#225;rio da aluna: CPF e senha= 8 d&#237;gitos do CPF.&lt;/p&gt;
&lt;p&gt;Solicitar que a aluna acesse o perfil.ufal.br e altere sua senha.&lt;/p&gt;

&lt;p&gt;S.O. Instalado...&lt;/p&gt;
&lt;p&gt;Programas essenciais instalados...&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;M&#225;quina pronta para entrega.&lt;/p&gt;

&lt;p&gt;Pessoal,&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;O evento aconteceu e n&#227;o tivemos nenhuma manute&#231;&#227;o na redes como foi solicitado.&lt;/p&gt;

&lt;p&gt;Pessoal,&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Com o termino do vestibular, iremos fechar o chamado.&lt;/p&gt;

&lt;p&gt;A m&#225;quina iniciou processo de restaura&#231;&#227;o e ocorreu com sucesso.&lt;/p&gt;
&lt;p&gt;Retirei a solicita&#231;&#227;o de senha do usu&#225;rio GEAC, conforme solicitado pelo solicitante.&lt;/p&gt;
&lt;p&gt;Observa&#231;&#227;o: a m&#225;quina veio com um sistema operacional sem licen&#231;a e nada foi feito em rela&#231;&#227;o a isso.&lt;/p&gt;

&lt;p&gt;Pessoal,&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Eu estive no local e verifiquei que o problema estava resolvido, provavelmente deve ter sido por falta de energia que aconteceu ontem pr&#243;ximo ao setor.&lt;/p&gt;

&lt;p&gt;Compartilhei a pasta para os computadores novos e compartilhei a impressora solicitada.&lt;/p&gt;
&lt;p&gt;Pode fechar o chamado.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Mais uma vez fui l&#225; e dessa vez ensinei e escrevi um passo-a-passo de como eles deveriam proceder para adicionar a impressora compartilhada a cada usuario dos computadores.&lt;/p&gt;
&lt;p&gt;Pode fechar o chamado.&lt;/p&gt;

&lt;p&gt;A matr&#237;cula j&#225; havia sido gerada.&lt;br /&gt;Proceder com os reaproveitamentos via DRCA e coordena&#231;&#227;o e solicitar matr&#237;cula.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Aluno informado quando compareceu ao NTI e foi encaminhado ao DRCA.&lt;/p&gt;

&lt;p&gt;Pessoal,&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Provavelmente algum dos esquipamentos estava travado, depois de restartado voltou ao normal.&lt;/p&gt;

&lt;p&gt;Pessoal,&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Segue abaixo os dados de acesso:&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;usu&#225;rio: cpf&lt;/p&gt;
&lt;p&gt;senha: 123Mudar&lt;/p&gt;

&lt;p&gt;Resolvido.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;&lt;span style="font-size: xx-small;"&gt;Update Ocor_Lanc_Notas&#160;&lt;/span&gt;&lt;span style="font-size: xx-small;"&gt;Set Conceito_Tab = 615, Conceito_Item = 11, Nota = Null&lt;/span&gt;&lt;span style="font-size: xx-small;"&gt;Where Id_Par_Lanc_Nota = 415 and Conceito_Item is null and&lt;/span&gt;&lt;span style="font-size: xx-small;"&gt;&#160; &#160; &#160; (Id_Turma, Id_Curso_Aluno) in&lt;/span&gt;&lt;span style="font-size: xx-small;"&gt;&#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; (Select Cur.Id_Turma, Cur.Id_Curso_Aluno&lt;/span&gt;&lt;span style="font-size: xx-small;"&gt;&#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; From Cursos_Alunos Ca&#160;&lt;/span&gt;&lt;span style="font-size: xx-small;"&gt;&#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; Inner Join Curriculo_Aluno Cur On Cur.Id_Curso_Aluno = Ca.Id_Curso_Aluno&lt;/span&gt;&lt;span style="font-size: xx-small;"&gt;&#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; Inner Join Dbsm.Atividades_Curric A On A.Id_Ativ_Curric = Cur.Id_Ativ_Curric&lt;/span&gt;&lt;span style="font-size: xx-small;"&gt;&#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; Inner Join Versoes_Cursos V On V.Id_Versao_Curso = Ca.Id_Versao_Curso&lt;/span&gt;&lt;span style="font-size: xx-small;"&gt;&#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; Inner Join Cursos C On C.Id_Curso = V.Id_Curso And C.Nivel_Curso_Item = 3&lt;/span&gt;&lt;span style="font-size: xx-small;"&gt;&#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; Inner Join Estrutura_Curric E On E.Id_Versao_Curso = V.Id_Versao_Curso&lt;/span&gt;&lt;span style="font-size: xx-small;"&gt;&#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; inner join Disciplinas_Curric d on A.Id_Ativ_Curric = D.Id_Disciplina and D.Id_Estrutura_Cur = E.Id_Estrutura_Cur&lt;/span&gt;&lt;span style="font-size: xx-small;"&gt;&#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; Inner Join Sie_Web.Complemento_Curriculo_Aluno Ccur On Ccur.Id_Curric_Aluno = Cur.Id_Curric_Aluno&lt;/span&gt;&lt;span style="font-size: xx-small;"&gt;&#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; &#160; Where Cur.Ano = 2012 And Cur.Periodo_Item = 202 And D.Tipo_Disc_Item = 3 and Conceito_Item = 11);&lt;/span&gt;&lt;/p&gt;

&lt;p&gt;Modificado o acesso da soliciante:&lt;/p&gt;
&lt;p&gt;usu&#225;rio:&#160;10020563 (matr&#237;cula)&lt;/p&gt;
&lt;p&gt;senha:&#160;10020563 (a mesma matr&#237;cula - a aluna pode alterar essa senha em seu perfil)&lt;/p&gt;
&lt;p&gt;Endere&#231;o do moodle para essa p&#243;s: www.ead.ufal.br&lt;/p&gt;

&lt;p&gt;Pessoal,&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Aparentemente o switch estava travado ou o Voip, depois de restartado os equipamentos a conectividade voltou ao normal.&lt;/p&gt;

&lt;p&gt;Aluna encontra-se aprovada na disciplina HISB089.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;O Felipe pode excluir a matr&#237;cula da aluna para a disciplina Hist&#243;ria e Perspectivismo. Confirmar com ele se existe algum problema no sistema.&lt;/p&gt;

&lt;p&gt;Iran respondeu ao solicitante por e-mail, conforme abaixo:&lt;/p&gt;
&lt;p&gt;"&lt;span style="color: #222222; font-family: arial, sans-serif; font-size: x-small;"&gt;Prezados,&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /&gt;&lt;span style="color: #222222; font-family: arial, sans-serif; font-size: x-small;"&gt;Verifiquei novamente os arquivos enviados, um a um, e neles n&#227;o constam os problemas citados, mais especificamente CPF com 10 d&#237;gitos.&lt;/span&gt;&lt;br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /&gt;&lt;br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /&gt;&lt;span style="color: #222222; font-family: arial, sans-serif; font-size: x-small;"&gt;O que posso concluir &#233; o seguinte: os arquivos t&#234;m a extens&#227;o CSV, podendo ser visualizados no Excel. Acontece que o Excel, por padr&#227;o, considera os valores do CPF, telefone, ramal, etc., como n&#250;meros, desprezando assim os zeros &#224; esquerda. Imagino ent&#227;o que os arquivos foram abertos no Excel e salvos, excluindo assim todos os zeros &#224; esquerda de todos os valores num&#233;ricos.&lt;/span&gt;&lt;br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /&gt;&lt;br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /&gt;&lt;span style="color: #222222; font-family: arial, sans-serif; font-size: x-small;"&gt;Assim, pe&#231;o para que baixem novamente os arquivos que envio e os submetam ao SISUAB sem abri-los no Excel. Ou, ao menos, sem salv&#225;-los novamente.&lt;/span&gt;&lt;br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /&gt;&lt;br style="color: #222222; font-family: arial, sans-serif; font-size: 13px;" /&gt;&lt;span style="color: #222222; font-family: arial, sans-serif; font-size: x-small;"&gt;Caso desejem visualizar os dados, utilizem um editor de texto plano, como o Bloco de Notas, que os dados n&#227;o ser&#227;o alterados.&lt;/span&gt;&lt;/p&gt;
&lt;div style="color: #222222; font-family: arial, sans-serif; font-size: 13px;"&gt;&lt;span style="font-size: x-small;"&gt;Atenciosamente,&lt;/span&gt;&lt;br /&gt;&lt;br /&gt;&lt;span style="font-size: x-small;"&gt;&lt;strong&gt;Iran Rodrigues&lt;/strong&gt;&#160;-&#160;&lt;a style="color: #1155cc;" href="mailto:iran@nti.ufal.br" target="_blank"&gt;iran@nti.ufal.br&lt;/a&gt;&#160;"&lt;/span&gt;&lt;/div&gt;

&lt;p&gt;Pessoal,&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;O NTI n&#227;o faz bloqueio de sites, a n&#227;o ser que seja solicitado pela dire&#231;&#227;o da unidade. O COS tem um NTI, pode ser que eles tenham feito o bloqueio.&#160;&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Obs. Solicitem pra ele entrar em contato com o pessoal do NTI do COS.&lt;/p&gt;

&lt;p&gt;A solitica&#231;&#227;o dever&#225; ser realizada &#224; Propep, aos respons&#225;veis pelo Pibic (Berenice ou Prof. Pedro).&lt;/p&gt;
&lt;p&gt;O sistema Pibic permite que a altera&#231;&#227;o seja realizada a qualquer tempo, desde que seja pertinente.&lt;/p&gt;
&lt;p&gt;Ao realizar a altera&#231;&#227;o, os certificados corrigidos poder&#227;o ser obtidos pelo pr&#243;prio aluno ao acessar o sistema.&lt;/p&gt;

&lt;p&gt;Conseguimos imprimir documentos pela impressora, por&#233;m ser&#225; preciso recarregar o Toner.&lt;/p&gt;
&lt;p&gt;Pode fechar o chamado.&lt;/p&gt;
&lt;p&gt;Porque o chamado voltou?&lt;/p&gt;

&lt;p&gt;Perfil consultas ao acad&#234;mico, igual ao de Madileide.&lt;/p&gt;
&lt;p&gt;Informar ao solicitante.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;________________________________________________________________________________________&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Foi conferido o perfil de consultas ao acad&#234;mico, o qual, como o pr&#243;prio nome mostra, realiza somente consultas para o servidor em quest&#227;o, com consultas para os cursos &#224; dist&#226;ncia do Campus Macei&#243;.&lt;/strong&gt;&lt;br /&gt;&lt;strong&gt;Nesse tipo de perfil n&#227;o existe a possibilidade de altera&#231;&#227;o ou inser&#231;&#227;o de dados.&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Favor proceder com a verifica&#231;&#227;o e nos informar se esta tudo ok.&lt;br /&gt;&lt;br /&gt;&lt;/p&gt;

&lt;p&gt;Pessoal,&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;A conectividade voltou ao normal, eu expliquei que estavamos com a internet muito lenta por esta utilizando a rede comep&lt;/p&gt;

&lt;p&gt;O tutor j&#225; se encontrava cadastrado no Moodle e tem registrado que seu &#250;ltimo acesso foi h&#225; 15 dias.&lt;/p&gt;
&lt;p&gt;&#201; necess&#225;rio associar o tutor a demais turmas do curso de especializa&#231;&#227;o. Essa atividade passa a ser de responsabilidade da coordena&#231;&#227;o/secretaria dos cursos.&lt;/p&gt;
&lt;p&gt;Est&#225; anexado em documentos um tutorial de como associar um usu&#225;rio e definir seu papel: tutor ou estudante). Entrar em contato com a solicitante e passar essas informa&#231;&#245;es. Qualquer d&#250;vida ela deve tirar com a Central.&lt;/p&gt;

&lt;p&gt;O r&#225;dio do HU apresentou problemas durante o per&#237;odo da manh&#227;. Este r&#225;dio &#233; repons&#225;vel por fornecer a conectividade ao setor do solicitante. Neste &#237;nterim foram efetuados os devidos ajustes. No per&#237;odo da tarde j&#225; fora normalizado sua opera&#231;&#227;o.&#160;&lt;/p&gt;
&lt;p&gt;Destarte, o problema de lentid&#227;o na internet deve-se ao fato que a rede COMEP/RNP, da qual a UFAL aderiu recentemente, est&#225; enfrentando problemas a n&#237;vel nacional.&#160;&lt;/p&gt;
&lt;p&gt;Ps.: N&#227;o conseguimos contato telef&#244;nico com a solicitante para confirmarmos a solu&#231;&#227;o.&lt;/p&gt;

&lt;p&gt;Solucionado. Problema resolvido sem saber a origem.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Conferi os dados da conta da requerente e n&#227;o tinha nenhum problema com a conta.&lt;/p&gt;
&lt;p&gt;Retirei e coloquei as permiss&#245;es do usu&#225;rio. O usu&#225;rio voltou a visualizar a pasta normalmente.&lt;/p&gt;
&lt;p&gt;(A Internet na ASCOM estava muito lenta.)&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;

