&lt;p&gt;&lt;span style="font-size: x-small;"&gt;Segundo a resolu&#231;&#227;o CEPE25/2005, acess&#237;vel em &#160;http://www.ufal.edu.br/estudante/graduacao/legislacao/normas/documentos/resolucoes/resolucao_25_2005_CEPE&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style="font-size: x-small;"&gt;&lt;strong style="margin: 0px; padding: 0px; font-family: Arial, FreeSans, sans-serif; font-size: 12.727272033691406px; line-height: 19.196969985961914px;"&gt;Par&#225;grafo &#218;nico&lt;/strong&gt;&lt;span style="font-family: Arial, FreeSans, sans-serif; line-height: 19.196969985961914px;"&gt;&#160;- Nos casos de alunos que ingressaram na UFAL por transfer&#234;ncia de outra Institui&#231;&#227;o de Ensino Superior a contagem do tempo ser&#225; iniciada a partir do ingresso no Curso de origem.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&lt;span style="font-size: x-small;"&gt;Est&#225; faltando informar no curr&#237;culo da aluna as disciplinas cursadas na outra institui&#231;&#227;o que pode fazer aproveitamento de estudos.&lt;/span&gt;&lt;/p&gt;

&lt;p&gt;Fomos ao local, Alex e Roberto, e n&#227;o encontramos problema algum nas m&#225;quinas indicadas pelos usu&#225;rios.&lt;/p&gt;
&lt;p&gt;Caso os usu&#225;rios insistam na identifica&#231;&#227;o do erro, tem que ser aberto um NOVO CHAMADO, com os patrim&#244;nios de todas as m&#225;quinas que apresentam esse problema. E apenas UMA m&#225;quina deve ser encaminhada ao NTI para que possamos fazer um teste mais r&#237;gido, inicialmente.&lt;/p&gt;
&lt;p&gt;Esse chamado ser&#225; fechado.&lt;/p&gt;

