&lt;li style="margin-left: 15px;"&gt;&lt;strong&gt;Clicar no link "Esqueceu a senha?"&lt;/strong&gt;&#160;para que os procedimentos de redefini&#231;&#227;o da senha sejam enviados ao e-mail do usu&#225;rio. A senha antiga n&#227;o &#233; mais v&#225;lida, por isso tantos usu&#225;rios informaram que tentaram acessar a plataforma e receberam a mensagem "Usu&#225;rio ou senha inv&#225;lidos.".&lt;/li&gt;
&lt;li style="margin-left: 15px;"&gt;&lt;strong&gt;Clicar no link recebido no e-mail&lt;/strong&gt;. Este link possibilita a cria&#231;&#227;o de uma nova senha. Foi constatado que muitos usu&#225;rios clicaram no "Esqueceu a senha?" mas nunca acessaram o link enviado para o e-mail, permanecendo sem acesso.&lt;/li&gt;
