1.Mais faltas do que deveriam, falta não foi computada para os alunos específicos e sim para toda a turma;
2.As presenças não foram salvas para os alunos corretos, alunos que foram marcados como presente foram computados como faltosos.

SOLUTION:
&lt;p&gt;Depois de alguns testes, n&#227;o foi observado o problema.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Verificar com o solicitante se o problema persiste.&lt;/p&gt;
&lt;p&gt;Em caso positivo, deve ser especificado alguns casos de exemplos com nome de aluno e dia da frequ&#234;ncia.&lt;/p&gt;

&lt;p&gt;PERFIL CRIADO.&lt;/p&gt;
&lt;p&gt;LOGIN:CPF&lt;/p&gt;
&lt;p&gt;SENHA: N&#195;O FOI ALTERADA&lt;/p&gt;
&lt;p&gt;OBS:CASO ELA N&#195;O LEMBRE DA SENHA, FAVOR ALTERAR.&lt;/p&gt;

&lt;p&gt;O perfil do solcitante foi verificado, constatou-se que ele j&#225; possuia acesso ao protocolo da&#160;Ger&#234;cia de Serci&#231;&#245;s Gerais - GSG/SINFRA, mas n&#227;o possuia permiss&#227;o de registro de ferias.&lt;/p&gt;
&lt;p&gt;O solicitante pode abrir e despachar processos, solicitar produtos e fazr registro de f&#233;rias.&lt;/p&gt;
&lt;p&gt;Login e senha n&#227;o foram aterados, caso o solicitantante n&#227;o lembre, favor informa os procedimento de altera&#231;&#227;o de senha.&lt;/p&gt;

&lt;p&gt;Foi adicionado as permiss&#245;es de abrir e despachar processos, bem como solicita&#231;&#227;o de produtos, vinculados &#224; GSG.&lt;/p&gt;
&lt;p&gt;Sobre a marca&#231;&#227;o de f&#233;rias, foi passado a SINFRA como um todo, j&#225; que no Sie a lota&#231;&#227;o &#233; feita pelo setor como um todo. No caso, a servidora deve marcar as f&#233;rias dos servidores dos servidores dos setores aos quais compete, no caso a GSG.&lt;/p&gt;
&lt;p&gt;Nome de usu&#225;rio: CPF&lt;/p&gt;
&lt;p&gt;Senha: 6 primeiros d&#237;gitos do CPF (que deve ser alterada no primeiro acesso)&lt;/p&gt;

&lt;p&gt;Permiss&#245;es concedidas para abrir e tramitar processos, por parte da Unidade, secretaria DRCA.&lt;/p&gt;
&lt;p&gt;O usu&#225;rio deve entrar com a mesma senha de acesso ao Sie Web.&lt;br /&gt;Caso n&#227;o consiga, deve entrar em perfil.ufal.br e proceder com a atualiza&#231;&#227;o da senha.&lt;/p&gt;
