&lt;p class="MsoNormal"&gt;Chamado Conclu&#237;do.&lt;/p&gt;
&lt;p class="MsoNormal"&gt;As duas disciplinas s&#227;o disciplinas isoladas, por tanto n&#227;o devem constar no hist&#243;rico Anal&#237;tico do discente, o correto seria ter criado uma nova matricula de aluno isolado e vincular as disciplinas a essa matricula.&lt;/p&gt;
&lt;p class="MsoNormal"&gt;Conversamos com o servidor Cabral do DRCA, e o mesmo informou que nesses casos onde o aluno tiver disciplina isolada o mesmo deve pedir uma declara&#231;&#227;o no DRCA a parte do hist&#243;rico.&lt;/p&gt;
&lt;p class="MsoNormal"&gt;A discente beneficiada j&#225; foi atendida desta forma junto ao DRCA.&lt;/p&gt;

