&lt;p class="MsoNormal" style="text-align: justify;"&gt;Entramos em contato com a Servidora M&#225;rcia Valeria da Prograd, para informar que a disciplina EDFL027 METODOLOGIA DO ENSINO DO DESPORTO COLETIVO 2, &#233; obrigat&#243;ria e j&#225; foi ofertada em outros per&#237;odos, por tanto possui v&#237;nculos com turmas anteriormente criadas, qualquer mudan&#231;a seja: edi&#231;&#227;o, exclus&#227;o, adi&#231;&#227;o de m&#243;dulos afetar&#225; o hist&#243;rico de todos os alunos que j&#225; cursaram esta disciplina, por este motivo n&#227;o &#233; poss&#237;vel a exclus&#227;o dos m&#243;dulos&lt;span style="mso-spacerun: yes;"&gt;&#160; &lt;/span&gt;mencionados, a servidora da Prograd percebeu que na verdade n&#227;o existia erro na disciplina.&lt;/p&gt;
&lt;p&gt;&lt;span style="font-size: 11.0pt; line-height: 115%; font-family: 'Calibri','sans-serif'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: 'Times New Roman'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: PT-BR; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;"&gt;Por tanto nada a fazer ao referido chamado.&lt;/span&gt;&lt;/p&gt;

&lt;p&gt;Detectado um defeito no Chip DLP.&lt;/p&gt;
&lt;p&gt;N&#227;o ser&#225; poss&#237;vel fazer a manuten&#231;&#227;o, pela falta do componente.&lt;/p&gt;
&lt;p&gt;Pode ser devolvido.&lt;/p&gt;

