&lt;p&gt;Abertura de matr&#237;culas devem passar primeiramente para a PROGRAD.&lt;/p&gt;
&lt;p&gt;O memorando deve ser encaminhado a PROGRAD. Central, favor encaminh&#225;-lo.&lt;/p&gt;
&lt;p&gt;Entrar em contato com o coordenador do curso prof. Olival e inform&#225;-lo sobre o procedimento correto.&lt;/p&gt;

&lt;p&gt;O problema n&#227;o era nos computadores da Progep e sim nos Sites que estavam tentando acessar (DOU e Serpro). Favor fechar o chamado.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Favor corrigir o setor: PROGEP e nao PROPEP.&lt;/p&gt;

&lt;p&gt;A causa do problema foi identificada e solucionada.&lt;/p&gt;
&lt;p&gt;O relat&#243;rio enviado pela aluna foi reenviado.&#160;&lt;/p&gt;
&lt;p&gt;A orientadora j&#225; tem acesso ao relat&#243;rio.&lt;/p&gt;

&lt;p&gt;Ap&#243;s contato por telefone, a solicitante informou que a internet, desde ontem, est&#225; funcionando. Provavelmente deve ter sido um switch localizado em outro pr&#233;dio que estava desligado.&lt;/p&gt;
&lt;p&gt;Pode fechar o chamado ;)&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;Pessoal, liguei para a solicitante, agora a tarde a internet est&#225; funcionando, mas ela afirma que est&#225; oscilando, hora ter internet hora n&#227;o ter, &#233; constante. Favor abram chamado pro pessoal de redes para eles verificarem a situa&#231;&#227;o desses pontos de rede. Pois, provavelmente a solicitante voltar&#225; a ligar reclamando do mesmo problema.&lt;/p&gt;
&lt;p&gt;Pode fechar o chamado ;)&lt;/p&gt;

&lt;p&gt;Fiz alguns testes novamente com a solicitante mudando a configura&#231;&#227;o do papel, troquei a impressora e ainda o toner, de nenhuma maneira a impress&#227;o melhorou. O &#250;nico motivo encontrado para o problema, &#233; o papel que n&#227;o &#233; adequado para este tipo de trabalho.&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;A impressora imprime normalmente, o que acontece &#233; que na PROEX s&#227;o impressos v&#225;rios certificados de uma vez com um tipo de papel mais espesso e de superf&#237;cie lisa. Isso faz com que a tinta saia ainda fresca e quando toca os outros pap&#233;is faz com que a impress&#227;o fique borrada.&lt;/p&gt;

