&lt;p class="MsoNormal" style="text-align: justify;"&gt;N&#227;o foi poss&#237;vel reproduzir o problema, ao realizamos testes aqui no sistema n&#227;o conseguirmos reproduzir este problema, pois o sistema aqui tem se comportado como esperado. Entrar em contato com a solicitante pedido para mesma realizar o teste em outro computador, caso o problema persista vir at&#233; nossa central de atendimento para que possa nos auxiliar a identificar o problema.&lt;/p&gt;

&lt;p&gt;O NTI n&#227;o &#233; responsavel pelo dominio if.ufal.br e por isso n&#227;o podemos criar o site, o Italo foi informado por e-mail.&#160;&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;@domarques 20130403:&lt;/p&gt;
