CONTENT:
Nome: Joceline Costa Duarte Damasceno.
Categoria: Servidor;
Dados necessários: e-mail: joceline_duarte@hotmail.com / telefone: 8806-8871 / Siape: 2009677 / CPF: 00811593401;
Nível de acesso: Somente abrir processos (protocolo), Abrir e despachar processos (protocolo) e Almoxarifado (solicitação de produto);
Usuário responde: Parte da unidade (divisão ou seção): Programa de Pós-graduação em Serviço Social da Ufal.

SOLUTION:
&lt;p&gt;Caro professor,&lt;/p&gt;
&lt;p&gt;ficou decidido em reuni&#227;o que n&#227;o daremos mais assist&#234;ncia ao sistema SieWeb para cria&#231;&#227;o de novas funcionalidades, j&#225; que estamos em processo de implata&#231;&#227;o de novos sistemas gerencial e acad&#234;mico, os sistemas SIGs. Assim, n&#227;o ser&#225; poss&#237;vel atendimento da proposta.&lt;/p&gt;
&lt;p&gt;Ficamos &#224; disposi&#231;&#227;o para novos esclarecimentos e nova proposta.&lt;/p&gt;

&lt;p&gt;Fechar chamado.&lt;/p&gt;
&lt;p&gt;A impressora est&#225; prendendo direto o papel.&lt;/p&gt;
&lt;p&gt;Trouxe a impressora para o NTI.&lt;/p&gt;

&lt;p&gt;Aluna com acesso regular &#224; disciplina.&lt;br /&gt;Ela deve procurar o nome da disciplina no menu do lado esquerdo da tela.&lt;br /&gt;&lt;br /&gt;&lt;/p&gt;
&lt;p&gt;&#160;&lt;/p&gt;
&lt;p&gt;----------------------------&lt;/p&gt;
&lt;p&gt;Aluna inserida no ambiente&#160;&lt;a style="text-decoration: none; line-height: 1.2em; color: #ff9900; font-family: arial, san-serif; font-size: 13px;" title="PEDD036 - 2012.2" href="http://www.ead.ufal.br/course/view.php?id=2742"&gt;2012.2 - SABERES E METODOLOGIAS DO ENSINO DE CI&#202;NCIAS 1&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Havia enviado &#224; Transpal em 04/04, mas tive de reenviar o arquivo em 05/04. Questionei ao Tony da Transpal atrav&#233;s do e-mail gerenciavt@cartaobemlegal.com.br se o sistema deles havia processado corretamente os dados. Nenhum retorno foi dado. A Sunny disse que eu deveria fechar este chamado j&#225; que j&#225; enviei o arquivo. Vou faz&#234;-lo agora.&lt;/p&gt;
&lt;p&gt;Notei que o c&#243;digo do curso desse aluno foi enviado errado para a Transpal. &#201; um problema que est&#225; ocorrendo com alguns cursos, principalmente de mestrado. Foi enviado o c&#243;digo 2, que &#233; o c&#243;digo do curso de direito. Por esse motivo, enviei um e-mail para o bruno avisando a ele que dever&#225; pegar o formul&#225;rio no curso de direito.&lt;/p&gt;
&lt;p&gt;Atualiza&#231;&#227;o: Acabei de receber um aviso por e-mail do gmail que esse e-mail&#160;&lt;span style="font-family: 'Bitstream Vera Sans', arial, Tahoma, 'Sans serif'; font-size: 11px;"&gt;bruno.gapasi@gmail.com&lt;/span&gt;&#160;n&#227;o existe.&lt;/p&gt;
&lt;p&gt;Atualiza&#231;&#227;o: Liguei daqui do NTI para o celular dele, que consta no chamado. Avisei a ele o que estava tentando avisar por e-mail.&lt;/p&gt;

CONTENT:
A solicitante informa que acontecerá no dia 7 de abril de 2013 a realização do concurso público da prefeitura municipal de Santana do Ipanema. Ocorrerá nas cidades de Maceió, Arapiraca, Palmeira dos Índios, Santana do Ipanema, Olho d'água das flores, São José da Tapera e Pão de Açucar. Por isso é solicitado que nas datas de 5 à 7 de abril (sexta-feira à domingo), não sejam realizados serviços de manutenção na rede informatizada que venham interferir no funcionamento do site da COPEVE em razão da dependência fundamental e exclusiva do site:
* Alocação de colaboradores nas escolas;
* Impressão da folha de pagamento dos colaboradores;
* Impressão dos cartões de inscrição por parte dos candidatos;
* Consultas realizadas pelo CPD sobre efetivação da inscrição de candidatos.   
Setor: COPEVE

Categoria: Servidor;
Dados necessários: e-mail: melaniapedrosa@yahoo.com.br / telefone: 3214-1684 ou 9127-9433 / Siape: 1646873 / CPF: 00825171423;
Nível de acesso: Abrir e despachar processos (protocolo) - Férias. 
Usuário responde: Parte da unidade (divisão ou seção): Instituto de Ciências Biológicas  e da Saúde - ICBS.

